import "./Blogs.css"
import blogs from "../data/blogs"
export default function Blogs (){
    return(
        <div className="blogs-conyainer">
            <article>
                {blogs.map((item)=>(
                    <div className="card" key={item.id}>
                        <h2>{item.title}</h2>
                        <p>{item.content.substring(0,300)}</p>
                        <hr/>
                    </div>
                ))}
            </article>
        </div>
    )
}
